import React from 'react'
import { Row } from 'react-bootstrap';
import MainScreen from "../../component/MainScreen";
const ProfileScreen = () => {
    return <MainScreen title="EDIT PROFILE">
    <div>
        <Row className="profileContainer">
            <Col md={6}>
                Form
            </Col>
            <Col>
            Profilepicture</Col>
        </Row>
    </div>
    </MainScreen>
};

export default ProfileScreen;
